import{_ as e,o,c as t,O as a}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 13.1-346 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-346.md","filePath":"vacode/13.1-346.md"}'),r={name:"vacode/13.1-346.md"},i=a('<h1 id="§-13-1-346-definitions" tabindex="-1">§ 13.1-346 Definitions. <a class="header-anchor" href="#§-13-1-346-definitions" aria-label="Permalink to &quot;§ 13.1-346 Definitions.&quot;">​</a></h1><p>As used in this article:</p><p>&quot;Collective reserve account&quot; means an account on the corporate books representing the worker cooperative&#39;s entire net book value minus balances in any other equity accounts.</p><p>&quot;Member&quot; means an individual who has been accepted for membership in, and owns a membership share issued by, a worker cooperative.</p><p>&quot;Membership fee&quot; means an initial payment, if required by the articles of incorporation or bylaws of the worker cooperative, made by a worker to a worker cooperative as a condition of becoming a member.</p><p>&quot;Patronage&quot; means the amount of work performed for a worker cooperative, measured in accordance with criteria set forth in the articles of incorporation or bylaws of the worker cooperative.</p><p>&quot;Worker&quot; means an individual employed by a worker cooperative.</p><p>&quot;Worker cooperative&quot; means a corporation incorporated under the provisions of Article 3 (§ <a href="/vacode/13.1-618/">13.1-618</a> et seq.) of Chapter 9 that has elected to be governed by this article.</p><p>2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0673" target="_blank" rel="noreferrer">673</a>.</p>',9),n=[i];function s(c,p,d,h,l,u){return o(),t("div",null,n)}const _=e(r,[["render",s]]);export{m as __pageData,_ as default};
